INSERT INTO `announce` (`announce_id`, `announce_title`, `announce_content`) VALUES
(1, '通知', '<p><strong><span style=\"color: rgb(255, 0, 0);\">2024年赛总杆冠军 - 邱望青，净杆冠军 - Mike舒，</span></strong></p><p><strong><span style=\"color: rgb(255, 0, 0);\">获得2025年9月年赛冠名荣誉 -- “邱舒双冠杯”</span></strong><strong style=\"color: rgb(255, 0, 0);\"></strong></p>'),
(2, '喜报', '<p><span style=\"background-color: rgb(255, 255, 255);\"><span style=\"background-color: rgb(255, 255, 255); color: rgb(255, 0, 0);\"><strong>年赛总杆冠军 - 邱望青，亚军于学琛，季军Sam傅</strong></span></span></p><p><span style=\"background-color: rgb(255, 255, 255);\"><span style=\"background-color: rgb(255, 255, 255); color: rgb(255, 0, 0);\"><strong>年赛净杆冠军 - Mike舒，并列第二Gordon王，John程，Dylan徐</strong></span></span></p><p><br/></p>'),
(3, '资讯', '<p><br/></p><table><tbody><tr class=\"firstRow\"><td valign=\"top\" colspan=\"1\" rowspan=\"1\" style=\"word-break: break-all;\"><p><span style=\"font-size: 18px;\"><strong>2025年“双冠杯”</strong></span></p><p><span style=\"color: rgb(0, 112, 192); font-size: 16px;\">24年各月赛和年赛的总杆冠军和净杆冠军，获得25年月赛和年赛的冠名荣誉，并一起负责组织比赛。</span></p><p><span style=\"font-size: 16px;\">5月赛&nbsp;–&nbsp;“傅杨双冠杯” 傅罡/Kevin杨</span></p><p><span style=\"font-size: 16px;\">6月赛&nbsp;–&nbsp;“孙胡双冠杯” Ray孙/胡商</span></p><p><span style=\"font-size: 16px;\">7月赛&nbsp;–&nbsp;“吴宋双冠杯” Andy吴/宋涛</span></p><p><span style=\"font-size: 16px;\">8月赛&nbsp;–&nbsp;“于李双冠杯” 于学琛/李开单</span></p><p><span style=\"font-size: 16px;\">9月年赛&nbsp;– “邱舒双冠杯”&nbsp;邱望青/Mike舒</span></p><p><span style=\"font-size: 16px;\">诚邀鹰友报名义工，参与支持！</span><span style=\"font-size: 18px;\">&nbsp;</span></p></td></tr><tr><td valign=\"top\" colspan=\"1\" rowspan=\"1\" style=\"word-break: break-all;\"><p><span style=\"font-size: 18px;\"><strong>2024年华人队际赛选拔</strong></span></p><ul class=\" list-paddingleft-2\" style=\"list-style-type: disc;\"><li><p>24年华人队际赛将于9月4日（周三）在 RedCrest 红鸟球场举办。</p></li><li><p>每个球会派20人参加比赛，取其中18人最好成绩计算排名。</p></li><li><p>鹰会将由傅罡总领队，于学琛副领队挂帅参赛。</p></li></ul><p><br/></p><p><span style=\"color: rgb(0, 112, 192);\">参赛鹰友的选拔，将按鹰会差点排名的前17位，获得代表鹰会参赛的资格。</span></p><p>另外三名代表，由傅教头根据鹰友今年的状态和表现，确定参赛资格。</p></td></tr><tr><td valign=\"top\" colspan=\"1\" rowspan=\"1\" style=\"word-break: break-all;\"><span style=\"font-size: 18px;\"><strong>2024年“冠军杯”</strong></span><p><span style=\"color: rgb(0, 112, 192);\">去年各月赛和年赛总杆冠军，获得今年月赛和年赛冠名荣誉，并负责组织比赛。</span></p><ul class=\" list-paddingleft-2\" style=\"list-style-type: disc;\"><li><p>5月赛&nbsp;–&nbsp;赵满冠军杯&nbsp;<br/></p></li><li><p>6月赛&nbsp;–&nbsp;宋涛冠军杯&nbsp;</p></li><li><p>7月赛&nbsp;–&nbsp;山姆冠军杯&nbsp;</p></li><li><p>8月赛&nbsp;–&nbsp;金博冠军杯&nbsp;</p></li><li><p>9月年赛&nbsp;–&nbsp;学琛冠军杯&nbsp;</p></li><li><p>诚邀鹰友报名义工，参与支持！&nbsp;</p></li></ul><p><span style=\"font-size: 18px;\"><strong>2025年“双冠杯”</strong></span></p><p><span style=\"color: rgb(0, 112, 192);\">24年各月赛和年赛的总杆冠军和净杆冠军，同时获得25年月赛和年赛的冠名荣誉，并一起负责组织比赛。</span></p></td></tr><tr><td valign=\"top\" colspan=\"1\" rowspan=\"1\" style=\"word-break: break-all;\"><p><span style=\"font-size: 18px;\"><strong>鹰会Club Link会员，可以选择CL球场，录入周活动成绩和月赛分赛场成绩：</strong></span></p><p>鹰会Club Link会员越来越多，由于Club&nbsp;Link订场困难，不能保证月赛和周活动订到足够多的位置集体活动。2024年试行以下办法，加强Club Link鹰友参与活动：</p><p>1. <strong>周活动</strong>：如果Club Link的会员不能参加鹰会的周活动，只要4人以上一起订Club Link的任何场地，都可以提交成绩单，做为周活动成绩录入鹰会网站。&nbsp; &nbsp;&nbsp;</p><p>2. <strong>月赛</strong>：&nbsp; &nbsp;如果鹰会的月赛订不到Club Link球场足够多的位置集体活动，或Club Link的鹰友不能参加鹰会的月赛，只要6人以上一起订Club Link的任何场地，都可以提交成绩单，参与鹰会月赛的净杆排名。&nbsp; &nbsp;</p><p>欢迎Club Link鹰友提出更好的建议，把鹰会活动越办越好。</p></td></tr><tr><td valign=\"top\" colspan=\"1\" rowspan=\"1\" style=\"word-break: break-all;\"><span style=\"font-size: 18px;\"><strong>会员状态和网站报名：</strong></span><p><span style=\"font-size: 16px;\">1. 会员交纳会费后，会员状态将显示为“年度正式会员”，方可在网站上报名参加比赛和球会活动。</span></p><p><span style=\"font-size: 16px;\">2. 2024年会费$150 请 e-transfer 到 eega2022@hotmail.com&nbsp;收款已设置为自动存款，请在备注里写会员姓名。</span></p><p><span style=\"font-size: 16px;\">3. 鹰会财务总监 Jeffery Chi 确认收到会费后，网站上会将已交费会员调整为“年度正式会员”状态。</span></p><p><span style=\"font-size: 16px;\">4. 鹰会的活动和比赛，提前14天开放报名，活动前1天锁定报名，不能再做变更。</span></p><p><span style=\"font-size: 16px;\">5. 鹰会2024年第一次活动5月7日，请会员不晚于4月15日EMT会费，转为年度正式会员状态，报名参加活动。</span></p></td></tr><tr><td valign=\"top\" colspan=\"1\" rowspan=\"1\" style=\"word-break: break-all;\"><p><span style=\"font-size: 18px;\"><strong>感谢 John Cheng 赞助鹰会全体会员每人一件T恤</strong></span></p><p>23年7月25日 T恤签收表 和 全体会员尺码存档</p><p style=\"line-height: 16px;\"><img style=\"vertical-align: middle; margin-right: 2px;\" src=\"/admin/resource/tools/ueditor/dialogs/attachment/fileTypeImages/icon_pdf.gif\"/><a style=\"font-size:12px; color:#0066cc;\" href=\"/upload/article_file/20230727/1690434767355713.pdf\" title=\"T恤签收-20230725.pdf\">T恤签收-20230725.pdf</a></p><p><br/></p></td></tr><tr><td width=\"932\" valign=\"top\" style=\"word-break: break-all;\"><p><strong><span style=\"font-size: 18px;\">有关差点指数说明：</span></strong></p><ol class=\" list-paddingleft-2\" style=\"list-style-type: decimal;\"><li><p>尽量与国际标准接轨并考虑网站设计简单化，设定为会员要有4次成绩，才开始计算并在网站上看到差点。</p></li><li><p>现有会员已输入3次比赛成绩，所以只要再参加一次球会活动，输入成绩后就会看到差点指数，并能参加比赛的净杆排名。</p></li><li><p>已输入的三场成绩，因有些会员未能参加年赛和月赛，是根据历史水平估算和填写的成绩，不够精确请见谅。随着录入真实成绩的场次不断增加，差点指数将会越趋于真实。</p></li><li><p>新入会的会员，需要累积四场成绩之后，才能有差点指数显示，参与球会的净杆比赛排名。</p></li><li><p>网站上已录入每个球场各个T台的Raiting和 Slope系数，数据来源于Golf Canada 官方网站，会跟球场成绩单或某些网站公布的数据有出入。</p></li><li><p>以后参加活动和比赛，除了上交本场成绩还要注明T台，以免带来差点指数的统计错误。</p></li><li><p>会员参加活动和比赛，无论选择哪个T台开球，网站上均已录入对应的系数，都能够正确计算净杆数。</p></li><li><p>为保证按规定时间完成赛事，建议60岁以上和差点指数高于25的会员从白T开球。（如选蓝T，保证不影响速度）其余会员蓝T；35岁（含）以下，退后一个T台开球。</p><p><br/></p><p style=\"line-height: 16px;\">****&nbsp;<strong>R&amp;A&nbsp; USGA差点系统&nbsp;&nbsp;</strong><img style=\"vertical-align: middle; margin-right: 2px;\" src=\"/admin/resource/tools/ueditor/dialogs/attachment/fileTypeImages/icon_pdf.gif\"/><a style=\"font-size:12px; color:#0066cc;\" href=\"/upload/article_file/20230416/1681596560638853.pdf\" title=\"Rules-of-Handicapping.pdf\">Rules-of-Handicapping.pdf</a></p></li></ol></td></tr><tr><td width=\"932\" valign=\"top\" style=\"word-break: break-all;\"><p><strong><span style=\"font-size: 18px;\">2023年华人队际赛选拔</span></strong></p><ul class=\" list-paddingleft-2\" style=\"list-style-type: disc;\"><li><p><span style=\"color: rgb(0, 112, 192);\">23年华人队际赛将于9月5日在 Station Creek South球场举办。</span></p></li><li><p>每个球会派17人参加比赛，取其中14人最好成绩计算排名。</p></li><li><p>鹰会将由傅罡总领队，于学琛副领队挂帅参赛。</p></li></ul><p><br/></p><p><span style=\"color: rgb(0, 112, 192);\">参赛鹰友的选拔，将按鹰会差点排名的前14位，获得代表</span><span style=\"color: rgb(0, 112, 192);\">鹰会参赛的资格。</span></p><p>另外三名代表，由傅教头根据鹰友今年的状态和表现，确定参赛资格。</p></td></tr><tr><td valign=\"top\" style=\"word-break: break-all;\" rowspan=\"1\" colspan=\"1\"><p><strong><span style=\"font-size: 18px;\">月赛和年赛需要安排哪些事项：</span></strong></p><ol class=\" list-paddingleft-2\" style=\"list-style-type: decimal;\"><li><p>订球场，确定参赛人数后把分组名单提前传给球场，安排最近洞和最远距离插牌。</p></li><li><p>确定比赛形式和规则，例如“红蓝对抗赛”，红蓝分队和编组等。</p></li><li><p>采购前三名和最近洞最远距离的奖品。如果有赞助，采购抽奖礼品。</p></li><li><p>联系晚餐餐厅，提前预定菜单和价格，商量是否可以自带红酒啤酒。</p></li><li><p>收集并核对成绩单，确定成绩同时标注T台。交给指定人员输入网站，核对无误。</p></li><li><p>安排晚餐时发奖。拍照记录比赛获奖者，照片传到球会的邮箱。</p></li></ol></td></tr><tr><td width=\"932\" valign=\"top\" style=\"word-break: break-all;\"><strong><span style=\"font-size: 18px;\">2023年“会长杯” 2024年“冠军杯”</span></strong><p><span style=\"color: rgb(0, 112, 192);\">2023年是鹰会成立15周年，为感谢历届会长为球会发展</span></p><p><span style=\"color: rgb(0, 112, 192);\">做出的贡献，&nbsp;2023年月赛和年赛将以历任会长冠名。&nbsp;</span></p><ul class=\" list-paddingleft-2\" style=\"list-style-type: disc;\"><li><p>5月赛&nbsp;–&nbsp;庞海福会长杯&nbsp;</p></li><li><p>6月赛&nbsp;–&nbsp;井卫星会长杯&nbsp;</p></li><li><p>7月赛&nbsp;–&nbsp;覃培因会长杯&nbsp;</p></li><li><p>8月赛&nbsp;–&nbsp;吕友军会长杯&nbsp;</p></li><li><p>9月年赛&nbsp;–&nbsp;梁David/柴钢双会长杯&nbsp;</p></li><li><p>诚邀鹰友报名义工，参与支持！&nbsp;</p></li></ul><p>&nbsp;</p><p><span style=\"font-size: 18px;\"><strong><span style=\"color: rgb(0, 0, 0);\">2024年的月赛和年赛，将以2023年月赛和年赛的冠军冠名。</span></strong></span></p><p>每次月赛都有总杆冠军和净杆前三名，获总杆冠军的鹰友不参与以后月赛总杆竞争以及当月的净杆排名，明年月赛以总杆冠军名字冠名。年赛总杆冠军的名字，冠名明年的年赛。如年赛总杆冠军名字与月赛总杆冠军重名，将以年赛总杆成绩的排名顺延，冠名重名的月赛。获得冠名的各位总杆冠军和净杆前三名将共同主办明年的月赛和年赛。</p><p><br/></p><p>预祝鹰友发挥球技和水平，赢得总杆冠军和冠名的荣誉。</p></td></tr><tr><td width=\"932\" valign=\"top\" style=\"word-break: break-all;\"><p><strong><span style=\"font-size: 18px;\">第八届团队 （2025-2026年）</span></strong></p><ul class=\" list-paddingleft-2\" style=\"list-style-type: disc;\"><li><p>会长：傅罡&nbsp; &nbsp; 副会长：于学琛</p></li><li><p>理事：傅罡，于学琛，吕友军，王德举，邱望青，郜鸿，金华，戴悦，Jack张，郭涛</p></li></ul></td></tr><tr><td width=\"932\" valign=\"top\" style=\"word-break: break-all;\"><p><strong><span style=\"font-size: 18px;\">2024年鹰会财务报告</span></strong></p><p style=\"line-height: 16px;\"><img style=\"vertical-align: middle; margin-right: 2px;\" src=\"/admin/resource/tools/ueditor/dialogs/attachment/fileTypeImages/icon_pdf.gif\"/><a style=\"font-size:12px; color:#0066cc;\" href=\"/upload/article_file/20241026/1729907288963739.pdf\" title=\"FS 2024-EEGA.pdf\">FS 2024-EEGA.pdf</a></p><p><strong><span style=\"font-size: 18px;\">2023年鹰会财务报告</span></strong></p><p><strong><span style=\"font-size: 18px;\"></span></strong></p><p style=\"line-height: 16px;\"><img style=\"vertical-align: middle; margin-right: 2px;\" src=\"/admin/resource/tools/ueditor/dialogs/attachment/fileTypeImages/icon_pdf.gif\"/><a style=\"font-size:12px; color:#0066cc;\" href=\"/upload/article_file/20241005/1728061974919833.pdf\" title=\"FS 2023-EEGA.pdf\">FS 2023-EEGA.pdf</a></p><p><strong><span style=\"font-size: 18px;\">2022年鹰会财务报告</span></strong></p><p style=\"line-height: 16px;\"><img src=\"/admin/resource/tools/ueditor/dialogs/attachment/fileTypeImages/icon_pdf.gif\"/><a title=\"EEGA Accounting Dec 31-22 FS.pdf\" style=\"font-size:12px; color:#0066cc;\" href=\"/upload/article_file/20230321/1679371497831895.pdf\">EEGA Accounting Dec 31-22 FS.pdf</a></p><p><strong><span style=\"font-size: 18px;\"></span></strong></p><p style=\"line-height: 16px;\"><img src=\"/admin/resource/tools/ueditor/dialogs/attachment/fileTypeImages/icon_pdf.gif\"/><a title=\"EEGA Accounting Dec 31-22 BK.pdf\" style=\"font-size:12px; color:#0066cc;\" href=\"/upload/article_file/20230321/1679371518817011.pdf\">EEGA Accounting Dec 31-22 BK.pdf</a></p><p><strong><span style=\"font-size: 18px;\"></span></strong><br/></p></td></tr></tbody></table><p><br/></p><p><br/></p>');
INSERT INTO `article` (`article_id`, `article_category_id`, `article_title`, `article_content`, `article_date`, `article_description`, `article_img`) VALUES
(1, 1, '2022年 鹰会年赛', '<p><br/></p><p>2022年9月鹰会年赛 大合影</p><p><img title=\"202303141678768892211019.jpg\" src=\"/upload/article/202303141678768892211019.jpg\"/></p><p><br/></p><p>鹰友兴高采烈庆祝年赛举办成功</p><p><img title=\"202303141678768893399858.jpg\" src=\"/upload/article/202303141678768893399858.jpg\"/><br/></p><p><br/></p><p>最后一洞推杆</p><p><img title=\"202303171679027258151695.jpg\" alt=\"1-赛.jpg\" src=\"/upload/article/202303171679027258151695.jpg\"/></p><p><br/></p><p>木筷子第一洞</p><p><img title=\"202303141678768936154089.jpg\" src=\"/upload/article/202303141678768936154089.jpg\"/></p><p><br/></p>', '2022-09-27', '', '/upload/thumbnail/1_16790272976413ec6185cbb2.48437052.jpg'),
(2, 1, '2022年8月赛 - 属虎60生日宴', '<p><br/></p><p>2022年8月鹰友60大寿聚会照片</p><p><img title=\"202303171679027531951495.jpg\" alt=\"1-虎.jpg\" src=\"/upload/article/202303171679027531951495.jpg\"/></p><p><br/></p><p>同打80杆并以后9洞成绩排出名次的冠亚军得主：吕友军、王德举</p><p><img title=\"202303141678738373891024.jpg\" src=\"/upload/article/202303141678738373891024.jpg\"/></p><p><br/></p><p>8月赛最近洞获奖选手 - 邱师傅，John 程，赵鹏举</p><p><img title=\"202303141678738373835979.jpg\" src=\"/upload/article/202303141678738373835979.jpg\"/></p><p><br/></p><p>幸运奖： Bill 蔡，Samson 任，季军</p><p><img title=\"202303171679027635563433.jpg\" alt=\"4-虎.jpg\" src=\"/upload/article/202303171679027635563433.jpg\"/></p><p><br/></p><p>柴会长主持发奖</p><p><img title=\"202303141678738374265631.jpg\" src=\"/upload/article/202303141678738374265631.jpg\"/></p><p><br/></p><p>邱师傅给李明颁奖</p><p><img title=\"202303171679027968689488.jpg\" alt=\"5-虎.jpg\" src=\"/upload/article/202303171679027968689488.jpg\"/></p><p><br/></p><p>吃蛋糕🎂啦😀</p><p><img title=\"202303141678738374947423.jpg\" src=\"/upload/article/202303141678738374947423.jpg\"/></p><p><br/></p><p>抽奖啦！</p><p><img title=\"202303171679028006910338.jpg\" alt=\"8-虎.jpg\" src=\"/upload/article/202303171679028006910338.jpg\"/></p>', '2022-08-30', '', '/upload/thumbnail/1_16790280706413ef66e9c7e3.65132374.jpg'),
(3, 1, '鹰会历史照片 - 2008-2022', '<p><br/></p><p>红蓝对抗赛 - 蓝军获胜</p><p><img title=\"202303171678984029352391.jpg\" alt=\"H-1.JPG\" src=\"/upload/article/202303171678984029352391.jpg\"/></p><p><br/></p><p>第三次获得华人队际赛冠军</p><p><img title=\"202303171678984078163166.jpg\" alt=\"H-2.jpg\" src=\"/upload/article/202303171678984078163166.jpg\"/></p><p><br/></p><p>鹰虎对抗赛，鹰队捧杯！</p><p><img title=\"202303171678984205395244.jpg\" alt=\"H-3.jpg\" src=\"/upload/article/202303171678984205395244.jpg\"/></p><p><br/></p><p>2018年8月1日活动</p><p><img src=\"/upload/article/202308031690998924190916.jpg\" style=\"\" title=\"202308031690998924190916.jpg\"/></p><p><img src=\"/upload/article/202308031690998924440604.jpg\" style=\"\" title=\"202308031690998924440604.jpg\"/></p><p><img src=\"/upload/article/202308031690998924311434.jpg\" style=\"\" title=\"202308031690998924311434.jpg\"/></p><p><br/></p><p><br/></p><p>2022年7月27日活动</p><p><img src=\"/upload/article/202308031690998974854079.jpg\" style=\"\" title=\"202308031690998974854079.jpg\"/></p><p><img src=\"/upload/article/202308031690998974332622.jpg\" style=\"\" title=\"202308031690998974332622.jpg\"/></p><p><br/></p><p>2021年7月27日活动</p><p><img src=\"/upload/article/202308031690999080599200.jpg\" style=\"\" title=\"202308031690999080599200.jpg\"/></p><p><img src=\"/upload/article/202308031690999080423429.jpg\" style=\"\" title=\"202308031690999080423429.jpg\"/></p><p><br/></p><p><br/></p>', '2022-07-28', '请鹰友把2022年以前的活动照片，发邮件到 eega2022@hotmail.com\r\n注明活动的日期，每张照片的主题或内容。多谢大家！', '/upload/thumbnail/1_16790271126413eba87285c2.78390666.JPG'),
(5, 1, '2023年7月赛 - 覃培因会长杯', '<p><br/></p><p>2023年7月赛总杆冠军 Sam Fu (73杆）覃培因会长颁奖</p><p><img src=\"/upload/article/202307271690411751593566.jpg\" title=\"202307271690411751593566.jpg\" alt=\"2-冠军.jpg\"/></p><p><br/></p><p>7月赛净杆第一名 叶文 - 培因和美食专家郜鸿颁奖</p><p><img src=\"/upload/article/202307271690411897330976.jpg\" title=\"202307271690411897330976.jpg\" alt=\"3-净1.jpg\"/></p><p><br/></p><p>7月赛净杆第二名 Jack Zhang - 培因和赞助商John Cheng颁奖</p><p><img src=\"/upload/article/202307271690411945927222.jpg\" title=\"202307271690411945927222.jpg\" alt=\"4-净2.jpg\"/></p><p><br/></p><p>7月赛净杆第三/四名 -&nbsp; Andy Yao 和 David Chau 未参加晚餐</p><p><br/></p><p>7月赛净杆第五名 吕友军 - 培因和赞助商 Floyd Zhang 颁奖</p><p><img src=\"/upload/article/202307271690412279409629.jpg\" title=\"202307271690412279409629.jpg\" alt=\"5-净5.jpg\"/></p><p><br/></p><p>7月赛净杆第六名 David 梁 - 培因和赞助商宋涛颁奖</p><p><img src=\"/upload/article/202307271690412348619215.jpg\" title=\"202307271690412348619215.jpg\" alt=\"6-远1.jpg\"/></p><p><br/></p><p>7月赛最远距离奖 David 梁 - 培因和井卫星颁奖</p><p>这三位是鹰会最年长的三位会员，并都担任过会长，老当益壮，还能打最远！</p><p><img src=\"/upload/article/202307271690412494679317.jpg\" title=\"202307271690412494679317.jpg\" alt=\"7-远1.jpg\"/></p><p><br/></p><p>7月赛最近洞奖 共5位 - 培因老会长颁奖（右一）</p><p>左起：冉光，吕友军，李顶真，David 梁，Kevin 杨</p><p><img src=\"/upload/article/202307271690412601714947.jpg\" title=\"202307271690412601714947.jpg\" alt=\"8-近5.jpg\"/></p>', '2023-07-25', '', '/upload/thumbnail/1_169041276464c1a6dc8f0760.67729125.jpg'),
(6, 1, '24年冠军杯🏆 5位冠名得主出炉', '<p><br/></p><p>今年五位月赛冠军，获得明年月赛冠名荣誉！</p><p><br/></p><p>2024年5月赛 - “赵满冠军杯” 🏆</p><p>2024年6月赛 - “宋涛冠军杯” 🏆</p><p>2024年7月赛 - “山姆冠军杯” 🏆</p><p>2024年8月赛 - “金博冠军杯” 🏆</p><p>2024年9月赛 - “学琛冠军杯” 🏆</p><p><br/></p><p>傅罡（右一）总教头给5/6/7月赛三位冠军颁奖。</p><p>左起：Sam Fu, 宋涛，赵满</p><p><img src=\"/upload/article/202307271690426066693916.jpg\" title=\"202307271690426066693916.jpg\" alt=\"10-5月.jpg\"/></p><p><br/></p><p>2023年8月赛 - 郭涛给于学琛颁奖。</p><p><img src=\"/upload/article/202308301693378066859248.jpg\" title=\"202308301693378066859248.jpg\" alt=\"8-prize.jpg\"/></p><p><br/></p><p>2023年9月年赛 - 庞海福给金博颁奖。</p><p><img src=\"/upload/article/202309271695785599640743.jpg\" title=\"202309271695785599640743.jpg\" alt=\"s-2.jpg\"/></p><p><br/></p><p><br/></p>', '2023-09-25', '', '/upload/thumbnail/1_169041337364c1a93d8ccdb1.36117199.jpg'),
(7, 1, '鹰俊帅哥加华美女联谊赛', '<p><br/></p><p><br/></p><p>鹰队和加华女队联谊赛 - 红蓝组合</p><p><img src=\"/upload/article/202307271690437405614285.jpg\" title=\"202307271690437405614285.jpg\" alt=\"1-title.jpg\"/><img src=\"/upload/article/202307271690437447187775.jpg\" title=\"202307271690437447187775.jpg\" alt=\"2-blue.jpg\"/></p><p><br/></p><p>组委会辛苦了！</p><p><img src=\"/upload/article/202307271690437515115767.jpg\" title=\"202307271690437515115767.jpg\" alt=\"3-organize.jpg\"/></p><p><br/></p><p>赛后欢聚！</p><p><img src=\"/upload/article/202307271690437574616069.jpg\" title=\"202307271690437574616069.jpg\" alt=\"6-meal.jpg\"/><img src=\"/upload/article/202307271690437617811772.jpg\" title=\"202307271690437617811772.jpg\" alt=\"5-meal.jpg\"/><img src=\"/upload/article/202307271690437638396241.jpg\" title=\"202307271690437638396241.jpg\" alt=\"4-meal.jpg\"/><img src=\"/upload/article/202307271690437657603898.jpg\" title=\"202307271690437657603898.jpg\" alt=\"7-meal.jpg\"/></p>', '2023-06-20', '', '/upload/thumbnail/1_169043772264c2085ac07495.47777775.jpg'),
(8, 1, '2023年5月赛 - 庞海福会长杯', '<p><br/></p><p>感谢5月赛踊跃赞助的各位鹰友！</p><p>左起：郜鸿、赵满、Jim 王、庞海福、罗川、Kevin 杨</p><p><img src=\"/upload/article/202307271690438823253738.jpg\" title=\"202307271690438823253738.jpg\" alt=\"2-sponsors.jpg\"/></p><p><br/></p><p>宋涛获奖 - Joseph 颁奖</p><p><img src=\"/upload/article/202307271690438909530049.jpg\" title=\"202307271690438909530049.jpg\" alt=\"3-song.jpg\"/></p><p><br/></p><p>Andy Wu 获奖 - Joseph 颁奖</p><p><img src=\"/upload/article/202307271690438964120394.jpg\" title=\"202307271690438964120394.jpg\" alt=\"4-Andy.jpg\"/></p><p><br/></p><p>Ray Sun 和 培因一起获奖</p><p><img src=\"/upload/article/202307271690439008408179.jpg\" title=\"202307271690439008408179.jpg\" alt=\"5-ray-ying.jpg\"/></p><p><br/></p><p>Jeffrey Chi 获奖 - Kevin Yang 颁奖</p><p><img src=\"/upload/article/202307271690439083983846.jpg\" title=\"202307271690439083983846.jpg\" alt=\"6-Kevin.jpg\"/><br/></p><p><br/></p><p>红蓝队长握手言和 - Kevin Yang (左）罗川 （右)</p><p><img src=\"/upload/article/202307271690439176877200.jpg\" title=\"202307271690439176877200.jpg\" alt=\"7-red blue.jpg\"/></p>', '2023-05-30', '', '/upload/thumbnail/1_169043918964c20e15c621a1.66018766.jpg'),
(9, 1, '2023年8月赛 - 吕友军会长杯 兔爷🐇60大寿🍑', '<p><br/></p><p>祝贺兔爷🐇吕友军、刘安来、Samson 任、李开单 60大寿 🍑 鹰会同庆 🌹</p><p><img src=\"/upload/article/202308301693375865560731.jpg\" title=\"202308301693375865560731.jpg\" alt=\"5-birthday.jpg\"/></p><p><br/></p><p>2023年8月赛总杆冠军于学琛 (74杆）-&nbsp;吕友军会长颁奖</p><p><img src=\"/upload/article/202308301693374122904531.jpg\" title=\"202308301693374122904531.jpg\" alt=\"4-champion.jpg\"/></p><p><br/></p><p>8月赛净杆第一名 柴钢 / 第二名 Jack 张 - 赞助商 Justin Qian 和 Jason Yu 颁奖</p><p><img src=\"/upload/article/202308301693374363571091.jpg\" title=\"202308301693374363571091.jpg\" alt=\"3-1and2.jpg\"/></p><p><br/></p><p>8月赛净杆第3-6名 ，右起：Samson 任、宋涛、井卫星、David 戴 - 鹰会最年轻理事 于学琛颁奖</p><p><img src=\"/upload/article/202308301693374517785799.jpg\" title=\"202308301693374517785799.jpg\" alt=\"2-3to6.jpg\"/></p><p><br/></p><p>8月赛最近洞奖 共5位</p><p>左起：柴钢，Max 刘，Louie 刘，于学琛（颁奖）宋涛，傅罡</p><p><img src=\"/upload/article/202308301693374891287086.jpg\" title=\"202308301693374891287086.jpg\" alt=\"1-close.jpg\"/></p><p><br/></p><p>柴博抽中邱师傅获奖球包</p><p><img src=\"/upload/article/202308301693375214611920.jpg\" title=\"202308301693375214611920.jpg\" alt=\"6-lucky.jpg\"/></p><p><br/></p><p>Raymond Xu 抽到最大幸运奖 - 寿星Samson任和李开单 颁奖</p><p><img src=\"/upload/article/202308301693375323769645.jpg\" title=\"202308301693375323769645.jpg\" alt=\"7-lucky.jpg\"/></p><p><br/></p>', '2023-08-29', '', '/upload/thumbnail/1_169337649964eedff3dc7173.28218720.jpg'),
(10, 1, '2023年9月年赛 - 柴钢/David梁 双会长杯', '<p><br/></p><p>2023年9月鹰会年赛 大合影</p><p><img src=\"/upload/article/202309271695785929509403.jpg\" title=\"202309271695785929509403.jpg\" alt=\"s-9.jpg\"/></p><p><img src=\"/upload/article/202309281695840059199229.jpg\" title=\"202309281695840059199229.jpg\" alt=\"s-8.jpg\"/></p><p><br/></p><p>2023年9月年赛 - 于学琛第三次捧杯🏆 David 梁颁奖</p><p><img src=\"/upload/article/202309271695786066962814.jpg\" title=\"202309271695786066962814.jpg\" alt=\"s-1.jpg\"/><br/></p><p><br/></p><p>2023年9月年赛 - 金博获得净杆冠军 🏆 庞海福颁奖</p><p><img src=\"/upload/article/202309271695786206756476.jpg\" title=\"202309271695786206756476.jpg\" alt=\"s-2.jpg\"/></p><p><br/></p><p>2023年9月年赛 - 净杆亚军刘安来🥇季军 Max Liu 🥇 井卫星和郭涛颁奖</p><p><img src=\"/upload/article/202309271695786479686648.jpg\" title=\"202309271695786479686648.jpg\" alt=\"s-3.jpg\"/></p><p><br/></p><p>2023年9月年赛，最近洞奖（左起）Louie 刘，David 梁，覃培因，金博</p><p><img src=\"/upload/article/202309271695786617686003.jpg\" title=\"202309271695786617686003.jpg\" alt=\"s-4.jpg\"/></p><p><br/></p><p>感谢 Raymond Xu 赞助年赛5盒球抽奖！</p><p><img src=\"/upload/article/202309281695836500836385.jpg\" style=\"\" title=\"202309281695836500836385.jpg\"/></p><p><img src=\"/upload/article/202309281695836500528262.jpg\" style=\"\" title=\"202309281695836500528262.jpg\"/></p><p><img src=\"/upload/article/202309281695836500743521.jpg\" style=\"\" title=\"202309281695836500743521.jpg\"/></p><p><img src=\"/upload/article/202309281695836501375714.jpg\" style=\"\" title=\"202309281695836501375714.jpg\"/></p><p><img src=\"/upload/article/202309281695836501833292.jpg\" style=\"\" title=\"202309281695836501833292.jpg\"/></p><p><br/></p>', '2023-09-26', '', '/upload/thumbnail/1_16957866646513a6a8a083c3.16363872.jpg'),
(12, 1, '鹰会15周年“会长杯”圆满收官', '<p><br/></p><p>鹰会成立15周年，国会议员董韩鹏送来贺信，赞扬历届会长为鹰会做出的贡献！</p><p>左起：傅罡，井卫星，覃培因，庞海福，董韩鹏，David梁，郭涛</p><p><img src=\"/upload/article/202309271695787104953972.jpg\" title=\"202309271695787104953972.jpg\" alt=\"h-2.jpg\"/></p><p><br/></p><p>5月赛赞助商给庞海福会长戴高帽。左起：Kevin杨，庞海福，郜鸿，罗川</p><p><img src=\"/upload/article/202309271695787214698657.jpg\" title=\"202309271695787214698657.jpg\" alt=\"h-4.jpg\"/></p><p><br/></p><p>鹰会现任财长Jeffrey Chi, 服装赞助商John Cheng给井卫星会长戴高帽。</p><p><img src=\"/upload/article/202309271695787423174515.jpg\" title=\"202309271695787423174515.jpg\" alt=\"h-5.jpg\"/></p><p><br/></p><p>7月赛赞助商给覃培因会长戴高帽。左起：张宁，覃培因，Louie刘，John程</p><p><img src=\"/upload/article/202309271695787534257906.jpg\" title=\"202309271695787534257906.jpg\" alt=\"h-6.jpg\"/></p><p><br/></p><p>8月赛赞助商给傅罡总教头戴高帽。左起：Sheridan黄，于学琛，傅罡，Samson任，李开单</p><p>感谢傅教头率领鹰会多年参加华人队际赛，不断取得好成绩👍&nbsp;</p><p><img src=\"/upload/article/202309271695787843245585.jpg\" title=\"202309271695787843245585.jpg\" alt=\"h-8.jpg\"/></p><p><br/></p><p>感谢吕友军会长十几年如一日，服务鹰会任劳任怨👍</p><p><img src=\"/upload/article/202309271695788097341539.jpg\" title=\"202309271695788097341539.jpg\" alt=\"4-champion.jpg\"/></p><p><br/></p><p>鹰会头牌（主持人）冉光给柴钢会长戴高帽</p><p><img src=\"/upload/article/202309281695839163565809.jpg\" title=\"202309281695839163565809.jpg\" alt=\"L-3.jpg\"/></p><p><br/></p><p>董韩鹏国会议员致贺词。</p><p><img src=\"/upload/article/202309271695788196472487.jpg\" title=\"202309271695788196472487.jpg\" alt=\"h-10.jpg\"/></p><p><br/></p><p>老会长们与董韩鹏合影</p><p><img src=\"/upload/article/202309271695788275500886.jpg\" title=\"202309271695788275500886.jpg\" alt=\"h-9.jpg\"/></p><p><br/></p><p>国会议员董韩鹏给鹰会15周年的贺信</p><p><img src=\"/upload/article/202309281695836735354798.jpg\" style=\"\" title=\"202309281695836735354798.jpg\"/></p><p><img src=\"/upload/article/202309281695836735242021.jpg\" style=\"\" title=\"202309281695836735242021.jpg\"/></p><p><br/></p>', '2023-09-26', '', '/upload/thumbnail/1_16957883616513ad49d17930.75381247.jpg'),
(13, 1, '2024年5月赛 - 赵满冠军杯', '<p><br/></p><p>2024年5月赛总杆冠军 - 傅罡，净杆冠军 - Kevin杨，获得2025年5月赛冠名荣誉 -- “傅杨双冠杯”</p><p>5月赛组委会：赵满，Jack张，David沈 颁奖</p><p><img src=\"/upload/article/202405311717127055411382.jpg\" title=\"202405311717127055411382.jpg\" alt=\"1-双冠.jpg\"/></p><p><br/></p><p>2024年5月赛，4个最近洞奖（拿奖品者）左起：金博，宋涛，John程，金华</p><p><img src=\"/upload/article/202405311717127538575884.jpg\" title=\"202405311717127538575884.jpg\" alt=\"4-最近洞.jpg\"/></p><p><br/></p><p>2024年5月赛总杆冠军傅罡，左起：Jack张，赵满，傅罡，David沈</p><p><img src=\"/upload/article/202405311717127183653126.jpg\" title=\"202405311717127183653126.jpg\" alt=\"2-总杆.jpg\"/></p><p><br/></p><p>2024年5月赛净杆冠军Kevin杨，左起：David沈，赵满，Kevin杨，Jack张</p><p><img src=\"/upload/article/202405311717127280171595.jpg\" title=\"202405311717127280171595.jpg\" alt=\"3-净杆.jpg\"/></p><p><br/></p><p>2024年5月赛净杆亚军郜鸿，季军Samson任</p><p><img src=\"/upload/article/202406281719510939205022.jpg\" title=\"202406281719510939205022.jpg\" alt=\"10-净杆.jpg\"/></p><p><br/></p><p>2024年5月赛净杆第4名冉光，第5名Max刘 （月赛组委会全体颁奖）</p><p>左起：宋涛，赵满，Max刘，冉光， David沈，Jack张</p><p><img src=\"/upload/article/202405311717127899190615.jpg\" title=\"202405311717127899190615.jpg\" alt=\"5-净杆45.jpg\"/></p>', '2024-05-29', '', '/upload/thumbnail/1_171712897066594f0a6c7577.77019198.jpg'),
(14, 1, '2024年6月赛 - 宋涛冠军杯', '<p>2024年6月赛总杆冠军 - Ray孙，净杆冠军 - 胡商，获得2025年6月赛冠名荣誉 -- “孙胡双冠杯”</p><p>6月赛赞助商：宋涛，Max刘 给总杆冠军 Ray孙 颁奖</p><p><img src=\"/upload/article/202406281719511179842504.jpg\" title=\"202406281719511179842504.jpg\" alt=\"6月总杆.jpg\"/></p><p><br/></p><p>感谢6月赛赞助商：宋涛，Max刘，义工：Louie刘</p><p><img src=\"/upload/article/202406281719511307601444.jpg\" title=\"202406281719511307601444.jpg\" alt=\"赞助商.jpg\"/></p><p><br/></p><p>6月赛净杆冠军胡商，亚军Gordon王，季军Ray孙 （照片待补）</p><p><br/></p>', '2024-06-25', '', '/upload/thumbnail/1_1719511429667da985b7e704.22491478.jpg'),
(15, 1, '7月9日 - 鹰花联谊赛', '<p><br/></p><p>鹰花常开🦅🌹🙂</p><p><img src=\"/upload/article/202407221721584427121521.jpg\" title=\"202407221721584427121521.jpg\" alt=\"1-front.jpg\"/></p><p><br/></p><p>红队险胜✌</p><p><img src=\"/upload/article/202407221721584490796357.jpg\" title=\"202407221721584490796357.jpg\" alt=\"3-red.JPG\"/></p><p><br/></p><p>蓝队不服😋</p><p><img src=\"/upload/article/202407221721584608290852.jpg\" title=\"202407221721584608290852.jpg\" alt=\"4-blue.JPG\"/></p><p><br/></p><p>四位最近洞奖得主👍</p><p><img src=\"/upload/article/202407221721584678497481.jpg\" style=\"\" title=\"202407221721584678497481.jpg\"/></p><p><img src=\"/upload/article/202407221721584678459451.jpg\" style=\"\" title=\"202407221721584678459451.jpg\"/></p><p><img src=\"/upload/article/202407221721584678892972.jpg\" style=\"\" title=\"202407221721584678892972.jpg\"/></p><p><img src=\"/upload/article/202407221721584678492752.jpg\" style=\"\" title=\"202407221721584678492752.jpg\"/></p><p><br/></p><p>现金抽奖😍</p><p><img src=\"/upload/article/202407221721584843427201.jpg\" style=\"\" title=\"202407221721584843427201.jpg\"/></p><p><img src=\"/upload/article/202407221721584844841061.jpg\" style=\"\" title=\"202407221721584844841061.jpg\"/></p><p><img src=\"/upload/article/202407221721584844181421.jpg\" style=\"\" title=\"202407221721584844181421.jpg\"/></p><p><img src=\"/upload/article/202407221721584844530980.jpg\" style=\"\" title=\"202407221721584844530980.jpg\"/></p><p><img src=\"/upload/article/202407221721584844726023.jpg\" style=\"\" title=\"202407221721584844726023.jpg\"/></p><p><br/></p><p>礼品抽奖😍</p><p><img src=\"/upload/article/202407221721584927151461.jpg\" title=\"202407221721584927151461.jpg\" alt=\"luck.JPG\"/></p><p><br/></p><p>红队和蓝队4位队长👍</p><p><img src=\"/upload/article/202407221721585001133141.jpg\" title=\"202407221721585001133141.jpg\" alt=\"队长.JPG\"/></p><p><br/></p><p><br/></p><p><img src=\"/upload/article/202407221721585050537885.jpg\" style=\"\" title=\"202407221721585050537885.jpg\"/></