(16, 1, '2024年7月赛 - Sam傅冠军杯', '<p><br/></p><p>2024年7月赛总杆冠军 - Andy吴，净杆冠军 - 宋涛，获得2025年7月赛冠名荣誉 -- “吴宋双冠杯”</p><p>7月赛组委会：傅罡和金华，给净杆冠军宋涛颁奖</p><p><img src=\"/upload/article/202408011722490284864561.jpg\" title=\"202408011722490284864561.jpg\" alt=\"3-net.JPG\"/></p><p><br/></p><p>7月赛总杆冠军 Andy吴</p><p><img src=\"/upload/article/202408061722892214159416.jpg\" title=\"202408061722892214159416.jpg\" alt=\"2-gross.JPG\"/></p><p><br/></p><p>7月赛赞助商傅罡和义工金华，给净杆亚军李开单和季军郭涛颁奖</p><p><img src=\"/upload/article/202408011722489615341365.jpg\" title=\"202408011722489615341365.jpg\" alt=\"3-net23.JPG\"/></p><p><br/></p><p>7月赛义工 Louie刘（左一）颁发4位最近洞奖。右起：李开单，郜鸿，宋涛，金华</p><p><img src=\"/upload/article/202408011722489810494083.jpg\" title=\"202408011722489810494083.jpg\" alt=\"4-close.JPG\"/></p>', '2024-07-31', '', '/upload/thumbnail/1_172249016066ab1d30e45cf9.79811676.JPG'),
(17, 1, '8月14日 - 木兰雄鹰联谊赛', '<p><br/></p><p>鹰击长空，木兰飘香</p><p><img src=\"/upload/article/202408171723867275756872.jpg\" title=\"202408171723867275756872.jpg\" alt=\"2-all.JPG\"/></p><p><br/></p><p>红队蓝队四位队长，旗鼓相当握手言和</p><p><img src=\"/upload/article/202408171723867345899010.jpg\" title=\"202408171723867345899010.jpg\" alt=\"3-cptn.JPG\"/></p><p><br/></p><p>4个3杆洞，每洞2位最近洞获奖</p><p><img src=\"/upload/article/202408171723867463328387.jpg\" style=\"\" title=\"202408171723867463328387.jpg\"/></p><p><img src=\"/upload/article/202408171723867463908475.jpg\" style=\"\" title=\"202408171723867463908475.jpg\"/></p><p><img src=\"/upload/article/202408171723867463669348.jpg\" style=\"\" title=\"202408171723867463669348.jpg\"/></p><p><img src=\"/upload/article/202408171723867464828841.jpg\" style=\"\" title=\"202408171723867464828841.jpg\"/></p><p><br/></p><p>10组参赛选手合影留念</p><p><img src=\"/upload/article/202408171723867589291953.jpg\" style=\"\" title=\"202408171723867589291953.jpg\"/></p><p><img src=\"/upload/article/202408171723867590197871.jpg\" style=\"\" title=\"202408171723867590197871.jpg\"/></p><p><img src=\"/upload/article/202408171723867590430157.jpg\" style=\"\" title=\"202408171723867590430157.jpg\"/></p><p><img src=\"/upload/article/202408171723867590913148.jpg\" style=\"\" title=\"202408171723867590913148.jpg\"/></p><p><img src=\"/upload/article/202408171723867590121146.jpg\" style=\"\" title=\"202408171723867590121146.jpg\"/></p><p><img src=\"/upload/article/202408171723867590670748.jpg\" style=\"\" title=\"202408171723867590670748.jpg\"/></p><p><img src=\"/upload/article/202408171723867590770465.jpg\" style=\"\" title=\"202408171723867590770465.jpg\"/></p><p><img src=\"/upload/article/202408171723867591416689.jpg\" style=\"\" title=\"202408171723867591416689.jpg\"/></p><p><img src=\"/upload/article/202408171723867591595600.jpg\" style=\"\" title=\"202408171723867591595600.jpg\"/></p><p><img src=\"/upload/article/202408171723867591878713.jpg\" style=\"\" title=\"202408171723867591878713.jpg\"/></p><p><br/></p><p>欢乐抽奖</p><p><img src=\"/upload/article/202408171723867830749432.jpg\" style=\"\" title=\"202408171723867830749432.jpg\"/></p><p><img src=\"/upload/article/202408171723867830533669.jpg\" style=\"\" title=\"202408171723867830533669.jpg\"/></p><p><img src=\"/upload/article/202408171723867830667834.jpg\" style=\"\" title=\"202408171723867830667834.jpg\"/></p><p><img src=\"/upload/article/202408171723867830669674.jpg\" style=\"\" title=\"202408171723867830669674.jpg\"/></p><p><img src=\"/upload/article/202408171723867830420621.jpg\" style=\"\" title=\"202408171723867830420621.jpg\"/></p><p><img src=\"/upload/article/202408171723867830133101.jpg\" style=\"\" title=\"202408171723867830133101.jpg\"/></p><p><img src=\"/upload/article/202408171723867830791287.jpg\" style=\"\" title=\"202408171723867830791287.jpg\"/></p><p><img src=\"/upload/article/202408171723867830911933.jpg\" style=\"\" title=\"202408171723867830911933.jpg\"/></p><p><img src=\"/upload/article/202408171723867831112706.jpg\" style=\"\" title=\"202408171723867831112706.jpg\"/></p><p><img src=\"/upload/article/202408171723867831614282.jpg\" style=\"\" title=\"202408171723867831614282.jpg\"/></p><p><img src=\"/upload/article/202408171723868244828271.jpg\" style=\"\" title=\"202408171723868244828271.jpg\"/></p><p><img src=\"/upload/article/202408171723868244394379.jpg\" style=\"\" title=\"202408171723868244394379.jpg\"/></p><p><img src=\"/upload/article/202408171723868244375869.jpg\" style=\"\" title=\"202408171723868244375869.jpg\"/></p><p><img src=\"/upload/article/202408171723868244179541.jpg\" style=\"\" title=\"202408171723868244179541.jpg\"/></p><p><img src=\"/upload/article/202408171723868244406414.jpg\" style=\"\" title=\"202408171723868244406414.jpg\"/></p><p><img src=\"/upload/article/202408171723868244590573.jpg\" style=\"\" title=\"202408171723868244590573.jpg\"/></p><p><img src=\"/upload/article/202408171723868244206316.jpg\" style=\"\" title=\"202408171723868244206316.jpg\"/></p><p><img src=\"/upload/article/202408171723868245551388.jpg\" style=\"\" title=\"202408171723868245551388.jpg\"/></p><p><img src=\"/upload/article/202408171723868245507838.jpg\" style=\"\" title=\"202408171723868245507838.jpg\"/></p><p><img src=\"/upload/article/202408171723868245629263.jpg\" style=\"\" title=\"202408171723868245629263.jpg\"/></p><p><br/></p>', '2024-08-14', '', '/upload/thumbnail/1_172386827866c024761de406.76167913.JPG'),
(18, 1, '2024年8月赛 - 金博冠军杯', '<p><br/></p><p>2024年8月赛总杆冠军 - 于学琛，净杆冠军 - 李开单，获得2025年8月赛冠名荣誉 -- “于李双冠杯”</p><p>8月赛赞助商：Kevin吴，组委会金博，刘欣 给总杆冠军 Jason 于 颁奖 （小于妈妈很高兴）</p><p><img src=\"/upload/article/202408301725011057352457.jpg\" title=\"202408301725011057352457.jpg\" alt=\"2-gross.JPG\"/></p><p><br/></p><p>净杆亚军 郜鸿（中）季军 Tony王（左二）8月赛赞助商Kevin吴和组委会金博，刘欣颁奖</p><p><img src=\"/upload/article/202408301725011200876713.jpg\" title=\"202408301725011200876713.jpg\" alt=\"3-net.JPG\"/></p><p><br/></p><p>4位最近洞奖得主，左起：刘欣，宋涛，张宁，Ray孙。颁奖：Kevin吴和金博。</p><p><img src=\"/upload/article/202408301725011314159589.jpg\" title=\"202408301725011314159589.jpg\" alt=\"4-close.JPG\"/></p><p><br/></p><p>前四组，小组最好成绩奖：宋涛，黄利群，Ray孙，刘欣。</p><p><img src=\"/upload/article/202408301725011536368173.jpg\" title=\"202408301725011536368173.jpg\" alt=\"5-a low.JPG\"/></p><p><br/></p><p>后四组，小组最好成绩奖：Tony王，叶文，傅罡，于学琛。</p><p><img src=\"/upload/article/202408301725011717550309.jpg\" title=\"202408301725011717550309.jpg\" alt=\"6-b low.JPG\"/></p><p><br/></p><p>感谢8月赛赞助商Kevin吴（右一）和义工金博，刘欣，Jeffrey 池。（从右至左）</p><p><img src=\"/upload/article/202408301725011898648915.jpg\" title=\"202408301725011898648915.jpg\" alt=\"7-v.JPG\"/></p><p><br/></p><p><br/></p>', '2024-08-27', '', '/upload/thumbnail/1_172501196366d197fb176827.81096325.JPG'),
(19, 1, '2024年9月年赛 - 学琛冠军杯', '<p><br/></p><p>感谢年赛组委会成功举办年赛！（左起：Jacky胡，Kevin杨，Dylan徐, 于学琛，Jack张，吕友军）</p><p><img src=\"/upload/article/202410031727908245151894.jpg\" title=\"202410031727908245151894.jpg\" alt=\"12-organizer.jpg\"/></p><p><br/></p><p>2024年9月年赛总杆冠军 - 邱望青，净杆冠军 - Mike舒，获得2025年9月年赛冠名荣誉 -- “邱舒双冠杯”</p><p><br/></p><p>年赛组委会全体给邱师傅颁发总杆冠军大奖！</p><p><img src=\"/upload/article/202410031727908582173102.jpg\" title=\"202410031727908582173102.jpg\" alt=\"1-总.jpg\"/></p><p><br/></p><p>年赛组委会给 Mike舒颁发净杆冠军奖！</p><p><img src=\"/upload/article/202410031727908860488879.jpg\" title=\"202410031727908860488879.jpg\" alt=\"3-净.jpg\"/></p><p><br/></p><p>年赛总杆亚军于学琛，总杆季军 Sam 傅</p><p><img src=\"/upload/article/202410031727908967340442.jpg\" title=\"202410031727908967340442.jpg\" alt=\"2-总23.jpg\"/></p><p><br/></p><p>年赛3位净杆并列第二名：Gordon王，John程，Dylan徐</p><p><img src=\"/upload/article/202410031727909093707266.jpg\" title=\"202410031727909093707266.jpg\" alt=\"4-净2.jpg\"/></p><p><br/></p><p>年赛最近洞奖：井卫星，傅罡，于学琛，吕友军</p><p><img src=\"/upload/article/202410031727909389771889.jpg\" title=\"202410031727909389771889.jpg\" alt=\"5-close.jpg\"/></p><p><br/></p><p>年赛最远距离奖：Mike舒</p><p><img src=\"/upload/article/202410031727909162911523.jpg\" title=\"202410031727909162911523.jpg\" alt=\"6-far.jpg\"/></p><p><br/></p><p>鹰会幕后英雄奖：吕友军，David戴，Jim王，三位数年如一日为鹰友订场，Jeffrey池2年承担鹰会财务工作。<img src=\"/upload/article/202410031727909600315357.jpg\" title=\"202410031727909600315357.jpg\" alt=\"7-hero.jpg\"/></p><p><br/></p><p>鹰会特别贡献奖：John程赞助全体会员队服，王德举赞助全体会员每人一顶德举帽，年赛每人一条一杆进洞纪念球（冉光代领奖并发表感言）</p><p><img src=\"/upload/article/202410031727909818179980.jpg\" title=\"202410031727909818179980.jpg\" alt=\"8-best.jpg\"/></p><p><br/></p><p>感谢2024年月赛赞助商：赵满，傅罡，宋涛，Max刘，Kevin吴</p><p><img src=\"/upload/article/202410031727909999731082.jpg\" title=\"202410031727909999731082.jpg\" alt=\"9-sponsor.jpg\"/></p><p><br/></p><p>年赛抽奖</p><p><img src=\"/upload/article/202410031727910045988037.jpg\" title=\"202410031727910045988037.jpg\" alt=\"15-draw.jpg\"/></p>', '2024-09-28', '', '/upload/thumbnail/1_172791008566fdd0c5a0c560.24886211.jpg');
